import React,{Component} from 'react'

class StateExample extends Component{
    constructor(){
        super()
        this.state={
            message: 'Subscribe please !!'
        }
    }
    render(){
        return (
            <div>
                    <p>{this.state.message}</p>
                    <button>Follow</button>
            </div>
        
        )
    }
}
export default StateExample
